  [],\n\t\"revision_timestamp\": \"2016-07-27T22:54:42.750172\",\n\t\"name\": \"narrative-report-for-october-1937-valentine-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments for October of 1937. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, furbearers, predators, rodents, and reptiles- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  collections and receipts. Resource management is outlined; topics include grazing,
  haying, and fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses and Refuge participation. Photographs and a report on potholes
  in Watts Lake Valley are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
